func createTGeomPointSeqInner() *gomeos.TGeomPointSeq {
	p := gomeos.NewTGeomPointSeqFromWKB("")
	return p
}

func TestNewCreateTGeomPointSeqInner(t *testing.T) {
	gomeos.MeosInitialize("UTC")
	g_is := createTGeomPointSeqInner()
	empty_TGeomPointInst := gomeos.NewEmptyTGeomPointInst()
	temp_n := gomeos.TemporalInstantN(g_is, &empty_TGeomPointInst, 1)
	assert.Equal(t, temp_n.TPointOut(5), "POINT(496102.81365 6595154.14501)@2020-06-03 07:21:38.834+00")
	// // gomeos.MeosFinalize()
}

